import React from 'react'

class PharmacoTool extends React.Component{
    constructor(props){
        super(props);

    }
    render(){
        return(
            <div className={this.props.status?"pharma":'hide'}>
            <h3>PharmacoTool</h3>
            </div>
        )
    }
}
export default PharmacoTool;
